    #necklace:hover{

          animation: flip-horizontal-top 600ms 1s 3 both;
    }
    #icecream:hover{

      
          animation: slide-left 0.5s ease-in-out 5 alternate-reverse both;
        }
    #erwyn:hover {
  
          
  
    -webkit-animation: scale-up-center 0.5s cubic-bezier(0.390, 0.575, 0.565, 1.000) 1s 4 alternate-reverse both;

    }
    #gun:hover{
-webkit-animation: rotate-center 0.6s ease-in-out both;
          animation: rotate-center 0.6s ease-in-out both;


    }
#dad{
  -webkit-animation: scale-down-center 0.5s cubic-bezier(0.250, 0.460, 0.450, 0.940) 1s 3 alternate-reverse both;
          animation: scale-down-center 0.5s cubic-bezier(0.250, 0.460, 0.450, 0.940) 1s 3 alternate-reverse both;
}

  -webkit-animation: slide-fwd-center 0.45s cubic-bezier(0.250, 0.460, 0.450, 0.940) 3 alternate-reverse both;
          animation: slide-fwd-center 0.45s cubic-bezier(0.250, 0.460, 0.450, 0.940) 3 alternate-reverse both;

}

          background-color: rgba(204, 205, 255, 0.7);
          color: black;
          padding: .5em 2em .5em 1em;
          text-decoration: none;
          display: block;
      }
